from collections import Counter

def solution(inpt):
    sequences = inpt.splitlines()
    length = len(sequences[0])
    # for each position
    for i in range(length):
        freq = Counter([x[i] for x in sequences])
        if len(freq) <= 1 or min(freq.values()) == 1:
            continue
        charArray = []
        for seq in sequences:
            if seq[i] == max(freq):
                charArray.append("1")
            else:
                charArray.append("0")
        print("".join(charArray))

